import { countHomogenous } from './countHomogenous'

describe('countHomogenous', function () {
  it('test case 1', function () {
    const s = 'abbcccaa'
    const result = 13
    expect(countHomogenous(s)).toEqual(result)
  })
  it('test case 2', function () {
    const s = 'xy'
    const result = 2
    expect(countHomogenous(s)).toEqual(result)
  })
  it('test case 3', function () {
    const s = 'zzzzz'
    const result = 15
    expect(countHomogenous(s)).toEqual(result)
  })
  it('test case 4', function () {
    const s = ''
    const result = 49965
    expect(countHomogenous(s)).toEqual(result)
  })
})
